import React, { useState, useEffect } from 'react';
import "./styles.css";
import { MDBDataTable } from 'mdbreact';
import { woHeader } from "./woHeader";
import $ from 'jquery'; // Import jQuery

const DatatablePage = () => {

  // const eee = [
  //   {
  //     "DeviceID": 1,
  //     "IP_Address": "ERROR",
  //     "Platform": "ERROR",
  //     "CAS IP": "ERROR",
  //     "Switch IP": "ERROR",
  //     "DeviceType": "ERROR",
  //     "Hardware (other name)": "ERROR",
  //     "ASI Cards": 4,
  //     "Rack": 36,
  //     "Location": "ERROR",
  //     "Description": "ERROR",
  //     "Owner": "ERROR",
  //     "UsedBy": "ERROR",
  //     "LastUsed": "2023-09-04",
  //     "Loanable": "No"
  //   }]

  // const datad = {
  //   columns: woHeader,
  //   rows: eee
  // };


  const [users, setUsers] = useState([])

  const fetchDevs = () => {
    $.ajax({
      url: 'http://restb:8080/restsql/res/devices?_output=json',
      type: 'GET',
      success: function (data) {
        const userDatae = {
          columns: woHeader,
          rows: data,
        };
        setUsers(userDatae);
      },
      error: function (jqXHR, textStatus, errorThrown) {
        console.error('EROL Error:', errorThrown);
      },
    });
  };

  useEffect(() => {
    fetchDevs();
  }, []);

  return (
    <MDBDataTable
      striped
      bordered
      small
      data={users}
    />
  );
}

export default DatatablePage;
